import React, {useState} from 'react';
import { useRouter } from 'next/router'
import AdminLayout from "../components/AdminLayout";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import {Paper, TextField} from "@material-ui/core";
import Avatar from "@material-ui/core/Avatar";


export default function Profile() {
    const router = useRouter()
    const [userId, setUserId] = useState("");
    const [nMode, setNMode] = useState(true);

    return (
        <AdminLayout setNMode={setNMode} setUserId={setUserId}>
            <Typography variant="h5" gutterBottom style={{color: "grey", marginTop:15}}>
                Profile
            </Typography>

            {/* <Grid item xs={2} style={{justifyItems:"flex-end", justifyContent:"flex-end", backgroundColor:"", borderRadius:10}}> */}
                <Grid item xs={10} >
                    <Paper style={{backgroundColor:"",padding:20, color:"#fff", display:"flex"}}>
                    <Grid item xs={4} style={{backgroundColor:""}}>
                    <Avatar alt="Super Admin" src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGvQLQ8CE9JyN11FHwSx4McRKThU-tc1pk_A&usqp=CAU"} style={{width:300, height:300}}></Avatar>
                    </Grid>
                    <Grid item xs={5} style={{backgroundColor:""}}>
                                <Typography variant="body1" style={{color: "black", fontWeight:600, fontSize:20}}>
                                    {/* {userName !== ""? userName: "loading..."} */}
                                    Wee Chien
                                </Typography>
                                <Typography variant="caption" style={{color: "black"}} gutterBottom>
                                    {/* {role} */}
                                    Super admin
                                </Typography>
                                <Typography variant="body1" style={{color: "black"}} gutterBottom>
                                    {/* {role} */}
                                    Company: Karuna
                                </Typography>
                                <Typography variant="body1" style={{color: "black"}} gutterBottom>
                                    {/* {role} */}
                                    Phone: 011 51600450
                                </Typography>
                                <Typography variant="body1" style={{color: "black"}} gutterBottom>
                                    {/* {role} */}
                                    Email: Karuna@gamil.com
                                </Typography>
                </Grid>
                </Paper>
                </Grid>
                    
                    
                {/* </Grid> */}
        </AdminLayout>
    )
}
